pub struct Solution;

// @lc code=start

// NOTE: TLE on leetcode, but I think this is only because they don't run in release mode
// The largest test case runs in 0.1 seconds on my machine in release mode, but 0.7 seconds in debug.

impl Solution {
    pub fn largest_component_size(nums: Vec<i32>) -> i32 {
        let nums: Vec<_> = nums.into_iter().map(|x| x as u32).collect();
        largest_cc(&nums) as i32
    }
}

// O(n (lg n)^2), I think
fn largest_cc(nums: &[u32]) -> usize {
    if nums.is_empty() {
        return 0;
    }

    // initially, n singleton sets
    let mut sets = Sets::new(nums.len());

    let max = nums.iter().copied().max().unwrap();
    for p in primes_up_to(max) {
        // union, using the hyper-edge corresponding to this factor
        let mut first = None;
        for (i, &x) in nums.iter().enumerate() {
            if x % p == 0 {
                let j = *first.get_or_insert(i);
                sets.union(i, j);
            }
        }
    }

    // largest?
    sets.nodes.into_iter().map(|n| n.len).max().unwrap()
}

// O(n lg n) to compute.
// O(lg n) primes.
// (^ I think ?? tbh these are both vague guesses..)
fn primes_up_to(max_inclusive: u32) -> Vec<u32> {
    let n = 1 + max_inclusive as usize;
    let mut primes = vec![];

    let mut crossed_off = vec![false; n];

    for i in 2..n {
        if !crossed_off[i] {
            primes.push(i as u32);

            // Multiples of i can't be prime.
            let mut j = 2 * i;
            while j < n {
                crossed_off[j] = true;
                j += i;
            }
        }
    }

    primes
}

// union-find / disjoint-sets data structure
#[derive(Debug)]
struct Sets {
    nodes: Vec<Node>,
}

#[derive(Debug, Clone)]
struct Node {
    // None if this is a representative
    parent: Option<usize>,
    // height of this subtree; starting at 1 for singletons
    height: usize,
    // num nodes in this subtree
    len: usize,
}

impl Sets {
    // O(n)
    fn new(n: usize) -> Self {
        Self {
            nodes: vec![Node::new(); n],
        }
    }

    // O(lg n)
    fn union(&mut self, i: usize, j: usize) {
        let x = self.find(i);
        let y = self.find(j);
        assert!(self.nodes[x].parent.is_none());
        assert!(self.nodes[y].parent.is_none());
        
        if x == y {
            return;
        }

        // wlog x is taller
        let (x, y) = if self.nodes[x].height >= self.nodes[y].height {
            (x, y)
        } else {
            (y, x)
        };

        self.nodes[y].parent = Some(x);
        self.nodes[x].len += self.nodes[y].len;

        if self.nodes[x].height == self.nodes[y].height {
            self.nodes[x].height += 1;
        }
    }

    // O(lg n)
    fn find(&self, mut i: usize) -> usize {
        while let Some(p) = self.nodes[i].parent {
            i = p;
        }
        i
    }
}

impl Node {
    fn new() -> Self {
        Self {
            parent: None,
            height: 1,
            len: 1,
        }
    }
}

